return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n != 1);','language'=>'de_DE','pot-creation-date'=>'2025-06-09 11:34-0700','po-revision-date'=>'2025-06-09 11:35-0700','translation-revision-date'=>'2025-06-09 11:35-0700','project-id-version'=>'Print My Blog','x-generator'=>'Poedit 3.6','messages'=>['Purpose'=>'Zweck','Similar to Print My Blog Quick Print and dotEpub, but supporting Pro features. Great for printing your WordPress content as an eBook for reading from a tablet or phone, or uploading to eBook marketplaces like Amazon or Apple Book Store.'=>'Sehr ähnlich wie Print My Blog Free, aber unterstützt Pro-Funktionen. Ideal für das Drucken Ihrer WordPress-Inhalte.','A table of contents is generated and inserted into the book (no need to add it using an external service like Kindle Direct Publishing or Calibre).'=>'Ein Inhaltsverzeichnis wird generiert und in das Buch eingefügt (keine Notwendigkeit, es mit einem externen Dienst wie Kindle Direct Publishing oder Calibre hinzuzufügen).','Images are bundled into the book file so they can be used offline.'=>'Bilder werden in der Buchdatei gebündelt, damit sie offline verwendet werden können.','Image galleries are rearranged into a simple list of images which displays better on smaller devices.'=>'Bildergalerien werden in eine einfache Liste von Bildern umsortiert, die auf kleineren Geräten besser angezeigt wird.','If there are any features or options you want, %1$splease get in touch.%2$s'=>'Wenn sie Funktionen oder Optionen wünschen, %1$sbitte setzen Sie sich mit uns in Verbindung. %2$s','Features'=>'Features','Supports nesting articles (like posts and pages) into “parts”'=>'Unterstützt das Verschachteln von Artikeln (wie Beiträge und Seiten) in "Parts"','External hyperlinks (links to web pages not in the project) are left as working hyperlinks'=>'Externe Hyperlinks (Links zu Webseiten außerhalb des Projekts) werden als funktionierende Hyperlinks belassen','Internal hyperlinks (links to content included in the project) are converted into links to the appropriate page of the eBook'=>'Interne Hyperlinks (Links zu im Projekt enthaltenen Inhalten) werden in Links zur entsprechenden Seite des eBooks umgewandelt','The default title page can include: Project Title, Subtitle, Site URL, Date Printed, Credit to Print My Blog'=>'Die Standardtitelseite kann folgendes umfassen: Projekttitel, Untertitel, Website-URL, gedrucktes Datum, Gutschrift zum Drucken meines Blogs','Each article can include: Title, ID, Author, URL, Date Published, Categories and Tags, Featured Image, Excerpt, Custom Fields, Content'=>'Jeder Artikel kann folgendes enthalten: Titel, ID, Autor, URL, Veröffentlichtes Datum, Kategorien und Tags, Ausgewähltes Bild, Auszug, Inhalt','All images are automatically included in the ePub file (instead of merely pointing to the external image source). This makes the filesize larger, but allows users to view images while disconnected from the Internet.'=>'Alle Bilder werden automatisch in die ePub-Datei aufgenommen (anstatt nur auf die externe Bildquelle zu verweisen). Dadurch wird die Dateigröße größer, aber Benutzer können Bilder anzeigen, während sie nicht mit dem Internet verbunden sind.','Small images are automatically centered'=>'Kleine Bilder werden automatisch zentriert','Image galleries are converted into regular list of images, which look better on small screens.'=>'Bildergalerien werden in normale Bilderlisten umgewandelt, die auf kleinen Bildschirmen besser aussehen.','Page Layout'=>'Seitenlayout','The page design is mostly dictated by the app and device used for reading'=>'Das Seitendesign wird hauptsächlich von der App und dem Gerät bestimmt, die zum Lesen verwendet werden','Each article begins on a new page.'=>'Jeder Artikel beginnt auf einer neuen Seite.','ID:%s'=>'ID:%s','By %s'=>'Von %s','Powered by WordPress & Print My Blog'=>'Drucken Sie meinen Blog jetzt kostenlos','comments title' . "\4" . 'One Reply to &ldquo;%s&rdquo;'=>'Ein Kommentar zu &ldquo;%s&rdquo;','comments title' . "\4" . '%1$s Reply to &ldquo;%2$s&rdquo;'=>'%1$s Antwort auf &ldquo;%2$s&rdquo;' . "\0" . '%1$s Antworten auf &ldquo;%2$s&rdquo;','Printed on %1$s'=>'Gedruckt auf %1$s','Designed for a school, company, or organization that wants to include their name, logo, and colors throughout the PDF. Because of its exstensive use of colors, it’s usually best viewed from a computer or handheld device.'=>'Entwickelt für eine Schule, ein Unternehmen oder eine Organisation, die ihren Namen, ihr Logo und ihre Farben in die gesamte PDF-Datei einbeziehen möchte. Aufgrund seiner exstensiven Verwendung von Farben, Es ist in der Regel am besten von einem Computer oder Handheld-Gerät angezeigt.','Easier content editing because there are no nesting parts.'=>'Einfachere Inhaltsbearbeitung, da keine Verschachtelungsteile vorhanden sind.','All hyperlinks converted into footnotes'=>'Alle Hyperlinks, die in Fußnoten konvertiert werden','The title page can include your organization’s name, project title, issue number, list of authors, and an introductory paragraph.'=>'Die Titelseite kann den Namen Ihrer Organisation, den Projekttitel, die Ausgabenummer, die Autorenliste und einen einführenden Absatz enthalten.','Each article includes just its title and content'=>'Jeder Artikel enthält nur seinen Titel und Inhalt','The default title page includes a stylized banner (with customizable color) above a colored background featuring a large version of your company logo.'=>'Die Standardtitelseite enthält ein stilisiertes Banner (mit anpassbarer Farbe) über einem farbigen Hintergrund mit einer großen Version Ihres Firmenlogos.','Main matter pages fade from white to a color of your choosing in the corner where your logo and page number are shown.'=>'Hauptstoffseiten verblassen von weiß zu einer Farbe Ihrer Wahl in der Ecke, in der Ihr Logo und Ihre Seitenzahl angezeigt werden.','Page numbers in bottom-right corner, and article titles in the top-right. Front-matter’s pages are numbered with Roman numerals'=>'Seitenzahlen in der rechten unteren Ecke und Artikeltitel oben rechts. Die Seiten der Vorderseite sind mit römischen Ziffern nummeriert','Each article begins on a new page'=>'Jeder Artikel beginnt auf einer neuen Seite','Back matter uses your large company logo with background color'=>'Back matter verwendet Ihr großes Firmenlogo mit Hintergrundfarbe','Very similar to Print My Blog Quick Print, but supporting Pro features. Great for making a PDF for an easy-to-read digital backup of your favorite website content.'=>'Sehr ähnlich wie Print My Blog Quick Print, unterstützt aber Pro-Funktionen. Ideal für die Erstellung einer PDF-Datei für ein leicht lesbares digitales Backup Ihrer Lieblings-Website-Inhalte.','External hyperlinks (links to web pages not in the project) can be automatically converted to footnotes, left in-place, or removed'=>'Externe Hyperlinks (Links zu Webseiten, die nicht im Projekt enthalten sind) können automatisch in Fußnoten konvertiert, an Ort und Stelle gelassen oder entfernt werden','Footnotes only work with Pro'=>'Fußnoten funktionieren nur mit Pro','Internal hyperlinks (links to content included in the project) can be automatically converted to to footnotes, inline page references, left in-place, or removed'=>'Interne Hyperlinks (Links zu Inhalten, die im Projekt enthalten sind) können automatisch in Fußnoten, Inline-Seitenverweise, links an Ort und Stelle oder entfernt werden','Footnotes and page references only work with Pro PDF Service'=>'Fußnoten und Seitenverweise funktionieren nur mit Pro PDF Service','Limit image size by setting maximum height'=>'Beschränken der Bildgröße durch Festlegen der maximalen Höhe','Optionally automatically center images'=>'Optional automatisch Bilder zentrieren','Optionally float images to the top or bottom of each page'=>'Optional schweben Bilder an der Ober- oder Unterseite jeder Seite','Page numbers in bottom-right corner, article titles in the top-right, and part titles (if using parts) appear in the top-left corner. Front-matter’s pages are numbered with Roman numerals'=>'Seitenzahlen in der rechten unteren Ecke, Artikeltitel oben rechts und Teiletitel (bei Verwendung von Teilen) werden in der oberen linken Ecke angezeigt. Die Seiten der Vorderseite sind mit römischen Ziffern nummeriert','Most browsers add their own content to the page margins'=>'Die meisten Browser fügen ihre eigenen Inhalte zu den Seitenrändern hinzu','Each article can optionally begin on a new page'=>'Jeder Artikel kann optional auf einer neuen Seite beginnen','Designed to look good when viewed from a device or printing to paper. The two-column layout leads to more compact content, especially good if your content doesn’t require the full page width'=>'Entwickelt, um gut auszusehen, wenn sie von einem Gerät aus betrachtet werden oder auf Papier gedruckt werden. Das zweispaltige Layout führt zu kompakteren Inhalten, insbesondere dann, wenn Ihr Inhalt nicht die gesamte Seitenbreite erfordert.','Most browsers will only print a white background'=>'Die meisten Browser drucken nur einen weißen Hintergrund','Main matter is divided into two columns, while front matter uses the full page width.'=>'Hauptsache ist in zwei Spalten unterteilt, während Frontmaterie die gesamte Seitenbreite verwendet.','Some browsers don‘t support multiple columns'=>'Einige Browser unterstützen nicht mehrere Spalten','Content can be divided into parts with a special part opening area using the full page width.'=>'Der Inhalt kann mit der gesamten Seitenbreite in Teile mit einem speziellen Teileöffnungsbereich unterteilt werden.','The title page can include a title and preamble. Other content can immediately follow, without needing a page break.'=>'Die Titelseite kann einen Titel und eine Präambel enthalten. Andere Inhalte können sofort folgen, ohne dass ein Seitenumbruch erforderlich ist.','Each article includes just its title and content, and an optional dividing line to help distinguish between articles.'=>'Jeder Artikel enthält nur seinen Titel und Inhalt sowie eine optionale Trennlinie, um zwischen Artikeln zu unterscheiden.','If your content is already divided into columns, optionally automatically remove them to improve the layout.'=>'Wenn Ihr Inhalt bereits in Spalten unterteilt ist, entfernen Sie sie optional automatisch, um das Layout zu verbessern.','Optionally begin each post on a new page, or be shown immediately following the previous one.'=>'Beginnen Sie optional jeden Beitrag auf einer neuen Seite, oder werden Sie unmittelbar nach der vorherigen Seite angezeigt.','Optionally have each article title take up the full page width, or show them inside columns.'=>'Optional können Sie, dass jeder Artikeltitel die gesamte Seitenbreite aufnimmt oder sie in Spalten anzeigt.','Internal links (hyperlinks to content included in the project) are replaced with page references.'=>'Interne Links (Hyperlinks zu Inhalten, die im Projekt enthalten sind) werden durch Seitenverweise ersetzt.','External links (hyperlinks to content on the internet) are left as-is.'=>'Externe Links (Hyperlinks zu Inhalten im Internet) bleiben erhalten.','Most content is divided between two columns.'=>'Der größte Teil des Inhalts ist auf zwei Spalten aufgeteilt.','Page numbers in bottom-right corner, and part titles in the top-left. Front-matter’s pages are numbered with Roman numerals'=>'Seitenzahlen in der rechten unteren Ecke und Teiletitel oben links. Die Seiten der Vorderseite sind mit römischen Ziffern nummeriert','Special Instructions'=>'Spezielle Anweisungen','Front matter defaults to using the full page width. To force something to be divided into columns, add the CSS class "mayer-columns" inside your content.'=>'Front matter verwendet standardmäßig die gesamte Seitenbreite. Um zu erzwingen, dass etwas in Spalten unterteilt wird, fügen Sie die CSS-Klasse "mayer-columns" in Ihrem Inhalt hinzu.','Very similar to Print My Blog Quick Print, but supporting Pro features. Great for printing your WordPress content.'=>'Sehr ähnlich wie Print My Blog Free, aber unterstützt Pro-Funktionen. Ideal für das Drucken Ihrer WordPress-Inhalte.','For creating a printout of your WordPress content that saves paper and ink.'=>'Zum Erstellen eines Ausdrucks Ihres WordPress-Inhalts, der Papier und Tinte speichert.','This design uses a smaller font, small images, doesn’t add pagebreaks between articles, and avoids unnecessary extra information.'=>'Dieses Design verwendet eine kleinere Schriftart, kleine Bilder, fügt keine Seitenumbrüche zwischen Artikeln hinzu und vermeidet unnötige zusätzliche Informationen.','Perfect for editing and reviewing your content! Compact to conserve paper, lots of meta-information, and double-spaced text to allow for editor’s notes.'=>'Perfekt für die Bearbeitung und Überprüfung Ihrer Inhalte! Kompakt, um Papier, viele Meta-Informationen und Text mit doppeltem Abstand zu erhalten, um die Notizen des Editors zu ermöglichen.','External hyperlinks (links to web pages not in the project) can be automatically converted to footnotes or removed'=>'Externe Hyperlinks (Links zu Webseiten, die nicht im Projekt enthalten sind) können automatisch in Fußnoten konvertiert oder entfernt werden','Footnotes require Pro'=>'Fußnoten erfordern Pro','Internal hyperlinks (links to content included in the project) can be automatically converted to footnotes, inline page references, or removed'=>'Interne Hyperlinks (Links zu Inhalten, die im Projekt enthalten sind) können automatisch in Fußnoten, Inline-Seitenverweise oder entfernt werden','Footnotes and page references require Pro PDF Service'=>'Fußnoten und Seitenverweise erfordern Pro PDF Service','This design is meant for printing on both sides of the page so you see two pages at once (the "page spread"). So the left-hand page will be styled differently than the right-hand page.'=>'Dieses Design ist für den Druck auf beiden Seiten der Seite gedacht, so dass Sie zwei Seiten gleichzeitig sehen (die "Seitenverteilung"). Die linke Seite wird also anders formatiert als die rechte Seite.','Page numbers in bottom-outside corner, part titles appear in the top of the left page, article titles appear at the top of the right page. Front-matter’s pages are numbered with Roman numerals'=>'Seitenzahlen in der unteren äußeren Ecke, Teiletitel werden oben auf der linken Seite angezeigt, Artikeltitel oben auf der rechten Seite. Die Seiten der Vorderseite sind mit römischen Ziffern nummeriert','Multi-column newspaper design designed for printing. Wide images can span multiple columns and always snap to the nearest page edge to make a visually-appealing layout.'=>'Mehrspaltiges Zeitungsdesign für den Druck. Breite Bilder können sich über mehrere Spalten erstrecken und immer am nächsten Seitenrand einrasten, um ein visuell erscheinendes Layout zu erstellen.','The "Title page" is actually a special header on the front page containing your publication\'s title, issue number, date, and other optional prominent info (set on the design and project meta settings).'=>'Die "Titelseite" ist eigentlich eine spezielle Kopfzeile auf der Titelseite, die den Titel, die Ausgabenummer, das Datum und andere optionale wichtige Informationen Ihrer Publikation enthält (in den Design- und Projektmetaeinstellungen festgelegt).','Content is divided into two, three, or four columns.'=>'Der größte Teil des Inhalts ist auf zwei Spalten aufgeteilt.','The top margin contains the front page (publication title, issue number, date, etc.).'=>'Der obere Rand enthält die Titelseite (Publikationstitel, Heftnummer, Datum usw.).','Designed for duplex printing with the left page mirroring the right page\'s margins.'=>'Entwickelt für den Duplexdruck, wobei die linke Seite die Ränder der rechten Seite spiegelt.','Content can be divided into parts. Part openings and important articles\' titles and cover images take up the full page width, whereas regular articles compactly fit into columns.'=>'Inhalte können in Teile unterteilt werden. Teileöffnungen und Titel und Titelbilder wichtiger Artikel nehmen die volle Seitenbreite ein, während normale Artikel kompakt in Spalten passen.','Each article may include post title, ID, author, published date, categories and tags, URL, featured image, excerpt, custom fields, and content.'=>'Jeder Artikel kann folgendes enthalten: Titel, ID, Autor, URL, Veröffentlichtes Datum, Kategorien und Tags, Ausgewähltes Bild, Auszug, Inhalt','Issue and page number are in the outside top margin, the publication\'s title is in the middle top margin, and the publication date is in the inside top margin. The optional publication subtitle is underneath the other top-margin content.'=>'Ausgabe und Seitenzahl befinden sich am äußeren oberen Randrand, der Titel der Publikation am mittleren oberen Rand und das Veröffentlichungsdatum am mittleren oberen Rand. Das optionale Schlagwort befindet sich unter dem anderen Inhalt mit dem oberen Rand.','Section Templates'=>'Abschnittsvorlagen','Choose different styles for articles included in your project:'=>'Wählen Sie verschiedene Stile für Artikel aus, die in Ihrem Projekt enthalten sind:','Default Template: shows all content specified by the "Post Content" design setting (e.g. the article\'s title and featured image) in columns.'=>'Standardvorlage: Zeigt alle Inhalte, die durch die Designeinstellung "Inhalt posten" angegeben werden (z. B. den Titel des Artikels und das vorgestellte Bild) in Spalten an.','Single Column: like the default template, but in a single column.'=>'Einspaltig: Zeigt alle Inhalte, die durch die Designeinstellung "Inhalt posten" angegeben wurden, in einer einzigen Spalte an.','Fullpage Content: contains only the article\'s content (no title, featured image, etc.) all in a single, wide column.'=>'Vollseiteninhalt: Enthält nur den Inhalt des Artikels (kein Titel, ausgewähltes Bild usw.) in einer einzigen, breiten Spalte.','Full Column Content: like "Fullpage Content", except content is still divided into multiple columns..'=>'Vollständiger Spalteninhalt: wie "Ganzseitiger Inhalt", außer dass der Inhalt immer noch in mehrere Spalten unterteilt ist.','Important: shows the article\'s featured image and title across all columns, but other content is shown in multiple columns.'=>'Wichtig: Zeigt das vorgestellte Bild und den Titel des Artikels in allen Spalten an, aber andere Inhalte werden in mehreren Spalten angezeigt.','Parts start on a new page and include the part’s title, featured image, and content.'=>'Teile beginnen auf einer neuen Seite und enthalten den Titel, das vorgestellte Bild und den Inhalt des Teils.','Note that in order to improve page layout, all images and figures snap to the nearest page edge.'=>'Bilder in voller Breite nehmen alle Spalten ein und werden am nächsten Seitenrand ausgerichtet.','"Full width" images take up all columns and snap to the nearest page edge.'=>'Bilder in voller Breite nehmen alle Spalten ein und werden am nächsten Seitenrand ausgerichtet.','"Wide width" images take up 2 columns and snap to the nearest page edge.'=>'"Wide width" Bilder nehmen 2 Spalten ein und werden am nächsten Seitenrand ausgerichtet.','Only works with PMB’s Pro PDF Service.'=>'Funktioniert nur mit dem Pro PDF Service von PMB.','%1$sAdd the CSS class "%2$s"%3$s to any images you don\'t want to snap like this.'=>'%1$s Fügen Sie die CSS-Klasse "%2$s"%3$s zu allen Bildern hinzu, die Sie nicht auf diese Weise aufnehmen möchten.','Issue %s, Page %s'=>'Ausgabe %s, Seite %s','Issue %s'=>'Ausgabe %s','Similar to Print My Blog Quick Print\'s other "Classic" designs, except optimized for reading by Microsoft Word. Useful when you need to deliver your content as a Microsoft Word Document (like to an editor), or for using as an intermediate format for delivery to other applications (like for importing into Adobe InDesign).'=>'Ähnlich wie die anderen "klassischen" Designs von Print My Blog Quick Print, außer für das Lesen von Microsoft Word optimiert. Nützlich, wenn Sie Ihre Inhalte als Microsoft Word-Dokument (z. B. an einen Editor) oder als Zwischenformat für die Bereitstellung an andere Anwendungen (z. B. für den Import in Adobe InDesign) bereitstellen müssen.','A table of contents is generated and inserted at the requested location. Once in Microsoft Word, right click on the table of contents and click "Update Field"; or press Ctrl + A, then F9.'=>'Ein Inhaltsverzeichnis wird generiert und an der gewünschten Stelle eingefügt. Sobald Sie in Microsoft Word sind, klicken Sie mit der rechten Maustaste auf das Inhaltsverzeichnis und klicken Sie auf "Feld aktualisieren"; oder drücken Sie Strg + A und dann F9.','Images may be bundled into the Word Document file so they can be used offline or if the website hosting the images goes offline.'=>'Bilder können in der Word-Dokumentdatei gebündelt werden, damit sie offline verwendet werden können oder wenn die Website, auf der die Bilder gehostet werden, offline geht.','External hyperlinks (links to web pages not in the project) may be left as working hyperlinks or removed'=>'Externe Hyperlinks (Links zu Webseiten außerhalb des Projekts) können als funktionierende Hyperlinks belassen oder entfernt werden','Internal hyperlinks (links to content included in the project) may be converted into links to the appropriate page of the document, left as hyperlinks to the website, or removed.'=>'Interne Hyperlinks (Links zu im Projekt enthaltenen Inhalten) können in Links auf die entsprechende Seite des Dokuments umgewandelt, als Hyperlinks auf der Website belassen oder entfernt werden.','All images are automatically included in the Word Document file (instead of merely pointing to the external image source). This makes the filesize larger, but allows users to view images while disconnected from the Internet.'=>'Alle Bilder werden automatisch in die Word-Dokumentdatei aufgenommen (anstatt nur auf die externe Bildquelle zu verweisen). Dadurch wird die Dateigröße größer, aber Benutzer können Bilder anzeigen, während sie nicht mit dem Internet verbunden sind.','Powered by Print My Blog Pro & WordPress'=>'Drucken Sie meinen Blog jetzt kostenlos','Purchase Required'=>'Prozente erworben','Works better with %1$sPro PDF Service%2$s'=>'Funktioniert besser mit %1$sPro PDF Service%2$s','More Advanced Features in %1$sPro Print%2$s'=>'Erweiterte Funktionen in %1$sPro Print%2$s','Drag the %s "%s" into your project'=>'Ziehen Sie die %s "%s" in Ihr Projekt','View "%s"'=>'Ansicht “%s“','Edit "%s"'=>'%s bearbeiten','Replace "%s" with the existing Print Material for customizing.'=>'Ersetzen Sie "%s" durch das vorhandene Druckmaterial zum Anpassen.','Replace "%s" with a New Print Material for customizing'=>'Ersetzen Sie "%s" durch ein neues Druckmaterial zum Anpassen','Upgrade to Professional License for one-click copying to Print Materials for customization.'=>'Upgrade auf Professional License für ein Klick Kopieren in Druckmaterialien zur Anpassung.','Add "%s" to project'=>'Hinzufügen von "%s" zum Projekt','Remove "%s"'=>'Entferne "%s"','Drag or click here'=>'Ziehen oder klicken Sie hier','Post custom field name' . "\4" . '%s:'=>'%s:','We’re sorry, but you have another version of Print My Blog active. Only one can be active at a time. Please deactivate one.'=>'Es tut uns leid, aber Sie haben eine andere Version von Print My Blog aktiv. Es kann jeweils nur einer aktiv sein. Bitte deaktivieren Sie eine.','We’re sorry, but Print My Blog requires PHP version %1$s or greater in order to operate. You are currently running version %2$s.%3$sIn order to update your version of PHP, you will need to contact your current hosting provider.%3$sFor information on stable PHP versions, please go to %4$s.'=>'Es tut uns leid, aber Print My Blog erfordert PHP-Version %1$s oder höher, um zu arbeiten. Sie führen derzeit Version %2$s aus. %3$s Um Ihre PHP-Version zu aktualisieren, müssen Sie sich an Ihren aktuellen Hosting-Anbieter wenden. %3$s Informationen zu stabilen PHP-Versionen finden Sie unter %4$s.','We’re sorry, but Print My Blog requires WordPress %1$s. You are using %2$s.%3$sFor information on how to update, please see %4$s.'=>'Es tut uns leid, aber Print My Blog erfordert WordPress %1$s. Sie verwenden %2$s. %3$s Informationen zum Aktualisieren finden Sie in %4$s.','360 Image Available'=>'360 Bild verfügbar','Language'=>'Sprache','All Languages'=>'Alle Sprachen','Default language (currently %s)'=>'Standardsprache (derzeit %s)','Translate %s Design'=>'Wählen Sie %s Design','%s Translations'=>'%s Übersetzungen','Translate Project Metadata'=>'Bearbeiten von Projektmetadaten','"%1$s" is fully translated into %2$s'=>'"%s" ist vollständig in %s übersetzt','Print My Blog'=>'Print My Blog','Pro Print'=>'Pro Print','Print My Blog – Quick Print'=>'Print My Blog – Schnelldruck','Quick Print'=>'Schnelldruck','Print My Blog Designs'=>'Meine Blogeinstellungen drucken','Designs'=>'Designs','Print My Blog Settings'=>'Meine Blogeinstellungen drucken','Settings'=>'Einstellungen','Help Me Print My Blog'=>'Hilfe zum Drucken meines Blogs','Help'=>'Hilfe','Keyboard Accessibility'=>'Eingabehilfen für die Tastatur','Settings Saved!'=>'Einstellungen gespeichert!','You should see the changes on your %1$slatest post%2$s.'=>'Sie sollten die Änderungen auf Ihrem %1$sletzten Beitragsehens%2$s sehen.','Show print buttons on:'=>'Drucktasten anzeigen auf:','Note: you need to upgrade your license to access the following formats: %s'=>'Hinweis: Sie müssen Ihre Lizenz aktualisieren, um auf die folgenden Formate zugreifen zu können: %s','Print Formats'=>'Druckformate','Email Print My Blog Support'=>'E-Mail Drucken des Supports für meinen Blog','Email successfully sent. Expect a reply in the next 1-2 business days.'=>'E-Mail wurde erfolgreich gesendet. Erwarten Sie eine Antwort in den nächsten 1-2 Werktagen.','There was an error sending an email from your website (it was "%1$s"). Please manually send an email to %2$s, with the subject "%3$s", with the content:'=>'Beim Senden einer E-Mail von Ihrer 