reitgestellt (%2$s)','%1$s is now the default design the %2$s on all new projects.'=>'%1$s ist jetzt das Standarddesign, das bei allen neuen Projekten %2$s.','Project Title'=>'Projekttitel','Format'=>'Format','Successfully setup the project "%s".'=>'Das Projekt "%s" wurde erfolgreich eingerichtet.','You need to choose and customize the design for your %s.'=>'Sie müssen das Design für Ihre %s auswählen und anpassen.','The content in your project has changed'=>'Der Inhalt in Ihrem Projekt hat sich geändert','Updated project content.'=>'Aktualisierter Projektinhalt.','You have customized this design'=>'Sie haben dieses Design angepasst','The design "%s" has been customized, and its changes will be reflected in all projects that use it.'=>'Das Design "%s" wurde angepasst, und seine Änderungen werden in allen Projekten widergespiegelt, die es verwenden.','You changed the design'=>'Sie haben das Design geändert','You chose the design "%1$s" for the %2$s of your project.'=>'Sie haben den Entwurf "%1$s" für die %2$s Ihres Projekts ausgewählt.','You changed projected metadata'=>'Sie haben projizierte Metadaten geändert','Project metadata updated.'=>'Projektmetadaten aktualisiert.','There is no file format with the slug "%s"'=>'Es gibt kein Dateiformat mit dem Slug "%s"','Save'=>'Speichern','Project successfully duplicated. It is titled "%1$s".'=>'Projekt erfolgreich dupliziert. Es trägt den Titel "%1$s".','Cached external resources and images were cleared.'=>'Zwischengespeicherte externe Ressourcen und Bilder wurden gelöscht.','Go to the %1$s "%2$s" was copied from.'=>'Zum Original %1$s wovon "%2$s" kopiert wurde.','Go to Original %s'=>'Zum Original %s','Go to Print Material "%s" was created from.'=>'Gehen Sie zu Druckmaterial, aus dem "%s" erstellt wurde.','Go to Print Material'=>'Druckmaterial','Copy "%s" to New Print Material for a Print My Blog project'=>'Kopieren von "%s" in neues Druckmaterial für ein Print My Blog-Projekt','Copy to Print Material'=>'Druckmaterial','Generate %s'=>'%s generieren','Nonce failure. Please refresh the page.'=>'Nonce-Versagen. Bitte aktualisieren Sie die Seite.','Show more...'=>'Mehr anzeigen...','No results. Try changing your search and filter criteria.'=>'Keine Ergebnisse. Versuchen Sie, Ihre Such- und Filterkriterien zu ändern.','Nonce failure'=>'Fehler','You do not have sufficient permissions to do this.'=>'Sie verfügen nicht über ausreichende Berechtigungen, um dies zu tun.','Unknown site name'=>'Unbekannter Sitename','No categories available.'=>'Keine Kategorien verfügbar.','Invalid Post ID. The link you used to get here may be old. If it\'s new, please contact Print My Blog support.'=>'Ungültige Beitrags-ID. Der Link, über den Sie hierher gelangt sind, ist möglicherweise alt. Wenn es neu ist, wenden Sie sich bitte an den Support von Print My Blog.','Unknown post type'=>'Unbekannter Beitragstyp','There seems to be an error initializing. Please verify you are using an up-to-date web browser.'=>'Es scheint einen Fehler beim Initialisieren zu geben. Stellen Sie sicher, dass Sie einen aktuellen Webbrowser verwenden.','Also check the WP REST API isn’t disabled by a security plugin. Feel free to contact Print My Blog support.'=>'Überprüfen Sie auch, ob die WP REST-API nicht durch ein Sicherheits-Plugin deaktiviert ist. Wenden Sie sich an den Print My Blog-Support.','Loading Content'=>'Inhalt laden','Loading Comments'=>'Laden von Kommentaren','Ordering Posts'=>'Posten bestellen','Ordering Comments'=>'Kommentare zur Bestellung','Placing Content on Page'=>'Platzieren von Inhalten auf der Seite','Optimizing for Print'=>'Optimieren für Print','Print-Page Ready'=>'Druckseite fertig','There was an error fetching posts. It was: '=>'Es gab einen Fehler beim Laden von Beiträgen bzw. Seiten. Fehler:','No response from WP REST API.'=>'Keine Antwort von wp REST API.','Sorry, There was a Problem 😢'=>'Es tut uns leid, es gab ein Problem 😢','%1$sRead our FAQs%2$s, then feel free to ask for help in %3$sthe support forum.%2$s'=>'%1$s Lesen Sie unsere FAQs%2$s, dann zögern Sie nicht, um Hilfe in %3$sdas Support-Forum zu bitten. %2$s','Comments'=>'Kommentare','No Comments'=>'Keine Kommentare','<span class="screen-reader-text says">says:</span>'=>'<span class="screen-reader-text says">Sagt:</span>','ID:'=>'ID:','By'=>'Von','Protected:'=>'Geschützt:','Private:'=>'privat:','Copied! Ready to paste.'=>'Kopiert! Bereit zum Einfügen.','There was an error copying. You can still select all the text manually and copy it.'=>'Beim Kopieren ist ein Fehler aufgetreten. Sie können den gesamten Text weiterhin manuell auswählen und kopieren.','Title'=>'Titel','Date'=>'Datum','Delete'=>'Löschen','Untitled'=>'Ohne Titel','Duplicate'=>'Duplizieren','Feature included in Professional and Business licenses'=>'Funktion in Professional- und Business-Lizenzen enthalten','Started'=>'Gestartet','%1$s at %2$s'=>'%1$s um %2$s','Y/m/d'=>'Y/m/d','g:i a'=>'g:i a','Click "Add New Project" 👆 To Make Your First Project!'=>'Klicken Sie auf "Neues Projekt hinzufügen" 👆, um Ihr erstes Projekt zu erstellen!','Classic Print PDf'=>'Klassische Druck-PDf','Font Settings'=>'Einstellungen Schriftart','Paragraph Indent'=>'Absatzeinzug','Indent the first line of each new paragraph instead of adding a paragraph break.'=>'Einrücken sie in die erste Zeile jedes neuen Absatzes, anstatt einen Absatzumbruch hinzuzufügen.','Link, Page Reference, and Footnote Settings'=>'Link-, Seitenreferenz- und Fußnoteneinstellungen','Remove'=>'Entfernen','Replace with page reference'=>'Ersetzen durch Seitenverweis','Replace with footnote'=>'Ersetzen durch Fußnote','Internal Hyperlinks'=>'Interne Hyperlinks','How to display hyperlinks to content included in this project.'=>'Anzeigen von Hyperlinks zu Inhalten, die in diesem Projekt enthalten sind.','External Hyperlinks'=>'Externe Hyperlinks','How to display hyperlinks to content not included in this project.'=>'Anzeigen von Hyperlinks zu Inhalten, die nicht in diesem Projekt enthalten sind.','Classic 