Columns'=>'Post-Header in Spalten anzeigen','Check this to make post header information, like title, date, author, etc, appear inside columns; uncheck this to have it take up the full page width'=>'Aktivieren Sie diese Option, um Post-Header-Informationen wie Titel, Datum, Autor usw. in Spalten erscheinen zu lassen. Deaktivieren Sie dies, damit die gesamte Seitenbreite in Anspruch nimmt','Show a Dividing Line Between Posts'=>'Zeigen einer Trennlinie zwischen Pfosten','Full-Column Images'=>'Vollständige Bilder','Resizes images to be the full column width (except ones with the CSS class "mayer-no-resize")'=>'Ändert die Größe der Bilder auf die gesamte Spaltenbreite (außer auf Bildern mit der CSS-Klasse "mayer-no-resize")','Remove Extra Columns'=>'Entfernen von zusätzlichen Spalten','Forces your content to only use two columns, even if the content itself was divided into more columns (eg using the "Columns" block)'=>'Erzwingt, dass Ihr Inhalt nur zwei Spalten verwendet, auch wenn der Inhalt selbst in weitere Spalten unterteilt wurde (z. B. mithilfe des Blocks "Spalten")','Byline'=>'Byline','Project author(s)'=>'Projektautor(e)','Classic ePub'=>'Klassische ePub','Convert Videos to Images and Links'=>'Konvertieren Sie Videos in Bilder und Links','Some eReaders don\'t show videos, in which case you may prefer to replace them with an image and a hyperlink to the online video content.'=>'Einige eReader zeigen keine Videos an, in diesem Fall können Sie es vorziehen, sie durch ein Bild und einen Hyperlink zum Online-Videoinhalt zu ersetzen.','Title page and Part Header Font Size'=>'Titelseite und Teilekopfschriftgröße','Font size used for the default title page’s and part’s header (all other headers’ sizes are derived from the main font size). Use any recognized %1$sCSS font-size keyword%2$s (like "large", "medium", "small") or a %3$slength in any units%2$s (eg "14pt", "50%%", or "10px").'=>'Schriftgröße, die für die Kopfzeile der Standardtitelseite und des Teils verwendet wird (alle anderen Formatleisten werden von der Hauptschriftgröße abgeleitet). Verwenden Sie ein beliebiges %1$sCSS-Schriftart-Schlüsselwort%2$s (wie "groß", "mittel", "klein") oder eine %3$sLänge in beliebigen Einheiten%2$s (z. B. "14pt", "50%%" oder "10px").','Custom Header Font'=>'Schriftart für Überschrift','Default font to use for headers of articles, parts, etc. Font files with extension "ttf" work with most eBook readers. Leave blank to use the default font.'=>'Standardschriftart für Kopfzeilen von Artikeln, Teilen usw. Schriftdateien mit der Erweiterung "ttf" funktionieren mit den meisten eBook-Readern. Lassen Sie das Feld leer, um die Standardschriftart zu verwenden.','Font Size'=>'Schriftgröße','Use any recognized %1$sCSS font-size keyword%2$s (like "large", "medium", "small") or a %3$slength in any units%2$s (eg "14pt", "50%%", or "10px").'=>'Verwenden Sie ein beliebiges %1$sCSS-Schriftart-Schlüsselwort%2$s (wie "groß", "mittel", "klein") oder eine %3$sLänge in beliebigen Einheiten%2$s (z. B. "14pt", "50%%" oder "10px").','Custom Font'=>'Benutzerdefinierte Schrift','Default font used in paragraphs, lists, tables, captions, etc. Font files with extension "ttf" work with most eBook readers. Leave blank to use the default font.'=>'Standardschriftart, die in Absätzen, Listen, Tabellen, Beschriftungen usw. verwendet wird. Schriftdateien mit der Erweiterung "ttf" funktionieren mit den meisten eBook-Readern. Lassen Sie das Feld leer, um die Standardschriftart zu verwenden.','File name'=>'Dateiname','Description'=>'Beschreibung','Shown as eBook metadata.'=>'Wird als eBook-Metadaten angezeigt.','Cover Image'=>'Titelbild','Cover image used on eBook file (does not necessarily appear inside project). Ideal dimensions are 2,560 x 1,600 pixels.'=>'Titelbild, das in der eBook-Datei verwendet wird (erscheint nicht unbedingt im Projekt)','Classic Word'=>'Klassische ePub','Headers and Footers'=>'Schriftart für Überschrift','Document Header on First Page'=>'Kopfzeile des Dokuments auf der ersten Seite','Content to appear in top margin area but only on the first page.'=>'Der Inhalt soll im oberen Randbereich angezeigt werden, jedoch nur auf der ersten Seite.','Document Header on Subsequent Pages'=>'Kopfzeile des Dokuments auf den nachfolgenden Seiten','Content to appear in top margin area on all pages except the first page.'=>'Der Inhalt soll auf allen Seiten mit Ausnahme der ersten Seite im oberen Randbereich angezeigt werden.','Document Footer'=>'Dokumenten-Fußbereich','Content to appear in bottom margin area.'=>'Inhalt von jedem Beitrag zum Drucken.','Some Word Processors don\'t show videos, in which case you may prefer to replace them with an image and a hyperlink to the online video content.'=>'Einige Textverarbeitungsprogramme zeigen keine Videos an, in diesem Fall möchten Sie sie möglicherweise lieber durch ein Bild und einen Hyperlink zum Online-Videoinhalt ersetzen.','Maximum Image Height (in pixels)'=>'Maximale Bildhöhe (in Pixel)','Larger images will be resized to this, smaller images will be unchanged.'=>'Größere Bilder werden in der Größe geändert, kleinere Bilder bleiben unverändert.','Leave as hyperlink to website'=>'Als Hyperlink zur Website hinterlassen','Leave as hyperlink to document'=>'Als Hyperlink zum Dokument belassen','Leave as hyperlink'=>'Als Hyperlink hinterlassen','Haller Tabloid Print PDF'=>'Haller Tabloiddruck PDF','Publication Logo Image'=>'Präambel der Veröffentlichung','Logo image to show on the front page and in the header of subsequent pages. Leave blank to just use a "Title of Publication".'=>'Logobild, das auf der Titelseite und in der Kopfzeile der nachfolgenden Seiten angezeigt wird. Lassen Sie das Feld leer, um nur einen "Titel der Publikation" zu verwenden.','Title of Publication'=>'Titel der Publikation','Shown in a large font on front page and in the top margin of every subsequent page.'=>'Wird in großer Schrift auf der Titelseite und am oberen Rand jeder nachfolgenden Seite angezeigt.','Subtitle of Publication'=>'Untertitel der Publikation','Shown under the name of the publication, in a slightly smaller font.'=>'Wird unter dem Namen der Publikation in etwas kleinerer Schrift angezeigt.','Publication Preamble'=>'Präambel der Veröffentlichung','Shown on the front page under the Title and Subtitle.'=>'Wird auf der Titelseite unter dem Titel und Untertitel angezeigt.','Columns'=>'Spalten','Number of columns to use for content.'=>'Anzahl der Spalten, die für Inhalte verwendet werden sollen.','Shown on frontpage and in the top margin of all subsequent pages.'=>'Wird auf der Startseite und am oberen Rand aller nachfolgenden Seiten angezeigt.','Issue Number'=>'Problem Nummer','Shown on the frontpage and in the top margin of all subsequent pages (shortcodes supported).'=>'Wird auf der Startseite und am oberen Rand aller nachfolgenden Seiten angezeigt (Shortcodes werden unterstützt).','Frontpage Title Left Call-Out'=>'Beschriftung "Titellinker Titel"','HTML displayed to the left of the title on the frontpage (shortcodes supported).'=>'HTML wird links neben dem Titel auf der Startseite angezeigt (Shortcodes werden unterstützt).','Frontpage Title Right Call-Out'=>'Call-Out "Titelrechter Titel"','HTML displayed to the right of the title on the frontpage'=>'HTML, das rechts neben dem Titel auf der Startseite angezeigt wird','Subtitle'=>'Untertitel','Source Location'=>'Quelle','Shown on the title page under the subtitle. Could be your website’s URL, or anything else you like.'=>'Wird auf der Titelseite unter dem Untertitel angezeigt. Könnte die URL Ihrer Website sein, oder alles andere, was Ihnen gefällt.','Site URL'=>'Seiten URL','Date Printed'=>'Datum gedruckt','Title Page Content'=>'Titelseiteninhalt','Post Title'=>'Beitragstitel','ID'=>'ID','Author'=>'Autor','Published Date'=>'Veröffentlichungsdatum','Categories and Tags'=>'Kategorien und Stichworte','URL'=>'URL','Featured Image'=>'Beitragsbild','Excerpt'=>'Auszug','Custom Fields'=>'Benutzerdefinierte Felder','Content'=>'Inhalt','Post Content'=>'Beitragsinhalt','Content from each post to print.'=>'Inhalt von jedem Beitrag zum Drucken.','Image & Block Settings'=>'Bild- und Blockeinstellungen','Page Settings'=>'Seiteneinstellungen','Page Width'=>'Seitenbreite','Not supported by some browsers'=>'Von einigen Browsern nicht unterstützt','Use standard %1$sCSS units%2$s'=>'Verwenden Sie Standard-%1$sCSS-Einheiten%2$s','Page Height'=>'Seitenhöhe','Your theme, "%1$s", can be used in conjunction with your design. Themes are often not intended for print and can conflict with the design, but you may have content that looks broken without the theme.'=>'Ihr Thema "%1$s" kann in Verbindung mit Ihrem Design verwendet werden. Designs sind oft nicht für den Druck gedacht und können mit dem Design in Konflikt stehen, aber Sie können Inhalte haben, die ohne das Thema gebrochen aussehen.','Note: this option is only supported for the business license.'=>'Hinweis: Diese Option wird nur für die Geschäftslizenz unterstützt.','Don’t Change Image Quality'=>'Ändern Sie die Bildqualität nicht','%s pixels wide'=>'%s Pixel breit','Full Size (on web)'=>'Full Size (im Web)','Uploaded Size (largest possible)'=>'Hochgeladene Größe (größtmögliche Größe)','Image Quality (in pixels)'=>'Maximale Bildhöhe (in Pixel)','Lower quality means smaller file size, whereas higher quality means higher resolution images. Note: if images are missing from the generated PDF, the requested image size might not be available. Use the %1$s Regenerate Thumbnails plugin%2$s to create the missing image sizes.'=>'Geringere Qualität bedeutet kleinere Dateigröße, während höhere Qualität Bilder mit höherer Auflösung bedeutet. Hinweis: Wenn Bilder in der generierten PDF-Datei fehlen, ist die angeforderte Bildgröße möglicherweise nicht verfügbar. Verwenden Sie das %1$s Regenerate Thumbnails Plugin%2$s um die fehlenden Bildgrößen zu erstellen.','Apply Website Theme'=>'Wenden Sie Website-Thema','Custom CSS'=>'Benutzerdefiniertes CSS','Styles to be applied only when printing projects using this design.'=>'Stile, die nur beim Drucken von Projekten mit diesem Entwurf angewendet werden sollen.','Add "Powered By"'=>'"Powered By" hinzufügen','In compliance with WordPress.org guidelines, not added when printing from your browser.'=>'Nur hinzugefügt, wenn Sie den Pro PDF Service für kostenlose und Hobbyist-Benutzer verwenden. In Übereinstimmung mit WordPress.org Richtlinien, die beim Drucken in Ihrem Browser nicht hinzugefügt werden.','Instructs the Pro PDF Service to add "Powered by Print My Blog Pro & WordPress" to your project. Does not appear when printing using your browser.'=>'Weist den Pro PDF Service an, "Powered by Print My Blog Pro & WordPress" in der Fußzeile der ersten Seite hinzuzufügen. Wird beim Drucken mit Ihrem Browser nicht angezeigt.','Page Reference Text'=>'Seitenreferenztext','Text to use when replacing a hyperlink with a page reference. "%s" will be replaced with the page number.'=>'Text, der beim Ersetzen eines Hyperlinks durch einen Seitenverweis verwendet werden soll. "%s" wird durch die Seitenzahl ersetzt.','(see page %s)'=>'(siehe Seite %s)','You must include "%s" in the page reference text so we know where to put the page number.'=>'Sie müssen "%s" in den Seitenreferenztext aufnehmen, damit wir wissen, wo die Seitenzahl gesetzt werden soll.','Internal Footnote Text'=>'Fußnotentext','Text to use when replacing a hyperlink with a footnote. "%s" will be replaced with the page number.'=>'Text, der beim Ersetzen eines Hyperlinks durch einen Seitenverweis verwendet werden soll. "%s" wird durch die Seitenzahl ersetzt.','See page %s.'=>'(siehe Seite %s)','You must include "%s" in the footnote text so we know where to put the URL.'=>'Sie müssen "%s" in den Fußnotentext aufnehmen, damit wir wissen, wo die URL abgelegt werden soll.','External Footnote Text'=>'Fußnotentext','Text to use when replacing a hyperlink with a footnote. "%s" will be replaced with the URL'=>'Text, der beim Ersetzen eines Hyperlinks durch eine foonote verwendet werden soll. "%s" wird durch die URL ersetzt','See %s.'=>'Siehe %s.','None'=>'Nichts','Center'=>'Zentriert','Default Image Alignment'=>'Standard-Bildausrichtung','Images normally default to "no alignment", which can look jumbled in printouts. Usually it’s best to automatically switch those to align to the center.'=>'Bilder werden normalerweise standardmäßig auf "keine Ausrichtung" verwendet, was in Ausdrucken durcheinander wirken kann. Normalerweise ist es am besten, diese automatisch zu wechseln, um sie an der Mitte auszurichten.','Don’t move'=>'Nicht bewegen','Snap to the top or bottom of the page'=>'Fangen am oberen oder unteren Rand der Seite','Only snap if it would otherwise cause a page break'=>'Fangen Sie nur, wenn das Bild einen Seitenumbruch verursachen würde','Resize images if they don’t fit on the page'=>'Ändern der Größe von Bildern, wenn sie nicht auf die Seite passen','Image and Block Placement'=>'Bild- und Blockplatzierung','Image snapping and dynamic resizing only works using the Pro PDF Service.'=>'Das Einrasten von Bildern und die dynamische Größenanpassung funktionieren nur mit Pro Print.','To reduce whitespace around images, galleries, and tables, Print My Blog can adjust the placement of your content, or resize it according to the space on the page.'=>'Um Leerzeichen um Bilder zu reduzieren, kann "Mein Blog drucken" Bilder in Ihren Inhalten verschieben.','Minimum Image Size (in pixels)'=>'Maximale Bildhöhe (in Pixel)','Any images larger than this may be resized to fit onto the page, but they will be no smaller than this size.'=>'Alle Bilder, die größer sind, können in der Größe geändert werden, um auf die Seite zu passen, aber sie werden nicht kleiner als diese Größe sein.','Add QR Code to Videos'=>'QR-Code zu Videos hinzufügen','After a video is converted into a screenshot and URL, you can optionally add a QR code that readers can scan with their phones to view the video.'=>'Nachdem ein Video in einen Screenshot und eine URL konvertiert wurde, können Sie optional einen QR-Code hinzufügen, den Leser mit ihren Telefonen scannen können, um das Video anzuzeigen.','Arial'=>'Arial','Courier New'=>'Courier New','Georgia'=>'Georgien','Impact'=>'Wirkung','Lucida Console'=>'Lucida Console','Palatino Linotype'=>'Palatino Linotyp','Tahoma'=>'Tahoma','Times New Roman'=>'Times New Roman','Verdana'=>'Verdana','Custom Font...'=>'Benutzerdefinierte Schriftart...','Header Font'=>'Schriftart für Überschrift','Default font for header tags'=>'Standardschriftart für Header-Tags','Specify the URL of a custom font file, or upload one. The formats "wff" and "wff2" work best, but "ttf" and "otf" also work.'=>'Geben Sie die URL einer benutzerdefinierten Schriftartdatei an oder laden Sie eine hoch. Die Formate "wff" und "wff2" funktionieren am besten, aber auch "ttf" und "otf".','Font'=>'Schriftart','Default font used in paragraphs, bulleted lists, tables, etc.'=>'Standardschriftart, die in Absätzen, Aufzählungslisten, Tabellen usw. verwendet wird.','A simple but flexible design intended mainly for reading from screens, inspired by Print My Blog Quick Print.'=>'Ein einfaches, aber flexibles Design, das hauptsächlich zum Lesen von Bildschirmen gedacht ist, inspiriert von Print My Blog Free.','Title page, with working hyperlinks.'=>'Titelseite mit funktionierenden Hyperlinks.','Main matter, showing hyperlinks and large images.'=>'Hauptsache, zeigt Hyperlinks und große Bilder.','Editorial Review'=>'Redaktionelle Rezension','Your writing in an easy-to-review format for editors.'=>'Ihr Schreiben in einem leicht zu überprüfenden Format für Redakteure.','Title page, showing the double-spaced text.'=>'Titelseite, auf der der Text mit doppeltem Abstand angezeigt wird.','Main matter, showing smaller images and double-spaced text.'=>'Hauptsache, zeigt kleinere Bilder und Text mit doppeltem Abstand.','Classic Print PDF'=>'Klassisch PDF drucken','A simple but flexible design intended for printing, inspired by Print My Blog Quick Print'=>'Ein einfaches, aber flexibles Design für den Druck, inspiriert von Print My Blog Free','Title page, showing removed hyperlinks.'=>'Titelseite, auf der entfernte Hyperlinks angezeigt werden.','Main matter, showing external hyperlinks automatically converted into footnotes. Page numbers are always on the bottom-outside corner, and each article’s title is shown at the top of right pages.'=>'Hauptsache, zeigt externe Hyperlinks automatisch in Fußnoten konvertiert. Seitenzahlen befinden sich immer in der unteren äußeren Ecke, und der Titel jedes Artikels wird oben auf den rechten Seiten angezeigt.','Economical Print PDF'=>'Sparsamer PDF-Druck','Compact design meant to save paper but still deliver all the content.'=>'Kompaktes Design soll Papier sparen, aber trotzdem alle Inhalte liefern.','Title page, showing smaller text.'=>'Titelseite, die kleineren Text anzeigt.','Main matter, showing smaller text and images to reduce ink usage.'=>'Hauptsache, zeigt kleineren Text und Bilder, um den Tintenverbrauch zu reduzieren.','Buurma Whitepaper'=>'Buurma Whitepaper','Stylized and branded PDF designed mainly for reading from a device, great for organizations'=>'Stilisiertes und markengebrandetes PDF, das hauptsächlich für das Lesen von einem Gerät entwickelt wurde, ideal für Organisationen','Title page, showing a stylzed upper margin for a company name, background gradient and logo, among other things.'=>'Titelseite, die unter anderem einen stylierten oberen Rand für einen Firmennamen, Hintergrundverlauf und ein Logo zeigt.','Main matter, showing working hyperlinks (which also each get an automatic footnote), and page number and logo in bottom-right corner.'=>'Hauptsache, zeigt funktionierende Hyperlinks (die auch jeweils eine automatische Fußnote erhalten), und Seitenzahl und Logo in der rechten unteren Ecke.','Issue 01'=>'Ausgabe 01','Text explaining the purpose of the paper and gives a brief summary of it, so folks know they’re reading the right thing.'=>'Text, der den Zweck des Papiers erklärt und eine kurze Zusammenfassung davon gibt, so dass die Leute wissen, dass sie das Richtige lesen.','Mayer Magazine'=>'Mayer Magazine','Digital 2-column magazine inspired by the defunct Zinepal'=>'Digitales 2-Säulen-Magazin inspiriert vom nicht mehr existierenden Zinepal','Title page and table of contents both fit on the first page.'=>'Titelseite und Inhaltsverzeichnis passen beide auf die erste Seite.','Two column layout which compactly shows content and images.'=>'Zweispaltenlayout, das Inhalte und Bilder kompakt anzeigt.','Simple ePub for using when uploading as an eBook to Amazon and other epub marketplaces'=>'Einfaches ePub zum Hochladen als eBook auf Amazon und andere epub-Marktplätze','Simple Microsoft Word document when that format is required.'=>'Einfaches Microsoft Word-Dokument, wenn dieses Format erforderlich ist.','Title page and table of contents.'=>'Titelseite und Inhaltsverzeichnis.','Simple layout'=>'Einfaches Layout','Haller Tabloid'=>'Haller Tabloid','Print-ready newspaper design'=>'Druckfertiges Zeitungsdesign','Digital PDF'=>'Digitales PDF','PDF file intended for viewing on a computer, tablet or phone, but not necessarily for printing to paper. Usually includes working hyperlinks, ample colors, and other features that require a device.'=>'PDF-Datei, die für die Anzeige auf einem Computer, Tablet oder Telefon, aber nicht unbedingt zum Drucken auf Papier bestimmt ist. In der Regel enthält funktionierende Hyperlinks, große Farben und andere Funktionen, die ein Gerät erfordern.','Print-Ready PDF'=>'Druckfertiges PDF','PDF file intended for printing on your home printer or with a printer service. Usually removes hyperlinks, avoids excessive ink use, and are designed for viewing the 2-page spread (using the front and back of a page).'=>'PDF-Datei zum Drucken auf Ihrem Heimdrucker oder mit einem Druckerservice. In der Regel werden Hyperlinks entfernt, übermäßige Tintenverwendung vermieden und sind für die Anzeige des 2-seitigen Spreads (mit der Vorder- und Rückseite einer Seite) konzipiert.','eBook (ePub)'=>'eBook (ePub)','ePub file intended for reading from an eReader, tablet, or phone; or for publishing on an eBook marketplace like Amazon\'s Kindle Direct Publishing, Apple Books, or Kobo.'=>'ePub-Datei zum Lesen von einem eReader, Tablet oder Telefon; oder für die Veröffentlichung auf einem eBook-Marktplatz wie Amazons Kindle Direct Publishing, Apple Books oder Kobo.','Create unlimited ePubs with any purchase.'=>'Erstellen Sie unbegrenzte ePubs mit jedem Kauf.','Word Document'=>'Word-Dokument','File editable in Microsoft Word, Google Docs, and LibreOffice (not Apple\'s Pages app, unfortunately). Useful for sharing persons and programs that require a ".doc" file. Word Documents typically require manual formatting in your chosen Word Processor.'=>'Datei editierbar in Microsoft Word, Google Docs, LibreOffice usw. Nützlich für die gemeinsame Nutzung von Personen und Programmen, die eine ".doc" -Datei erfordern. Word-Dokumente erfordern in der Regel eine manuelle Formatierung in dem von Ihnen gewählten Textverarbeitungsprogramm.','Create unlimited Word Documents with a Pro Plan.'=>'Erstellen Sie unbegrenzt Word-Dokumente mit einem Pro-Plan.','About Quick Print'=>'Über Quick Print','This is the quick-and-easy option, best for making printouts for your own records. For something more professional and full-featured, use %1$sPro Print%2$s. It has free and paid options. %3$sSee full feature comparison.%2$s'=>'Dies ist die schnelle und einfache Option, am besten für Ausdrucke für Ihre eigenen Aufzeichnungen zu machen. Für etwas professionelleres und voll funktionsfähigeres Verwenden Sie %1$sPro Print%2$s. Es hat kostenlose und kostenpflichtige Optionen. %3$s Siehe vollständige Feature-Vergleich. %2$s','About Pro Print'=>'Über Pro Print','Pro Print is the best way to make professional-quality documents. You will be able to print them for free using your browser, or upgrade to use Print My Blog Pro\'s full features. %1$sSee full feature comparison.%2$s'=>'Pro Print ist der beste Weg, um Dokumente in professioneller Qualität zu erstellen. Sie können sie kostenlos mit Ihrem Browser drucken oder aktualisieren, um die vollständigen Funktionen von Print My Blog Pro zu nutzen. %1$s Siehe vollständige Feature-Vergleich. %2$s','If you just want something quick, use %1$sQuick Print%2$s instead.'=>'Wenn Sie nur etwas schnell wollen, verwenden Sie stattdessen %1$sQuick Print%2$s.','Project Designs are like WordPress Themes'=>'Projekt-Designs sind wie WordPress-Themes','Each has a different look and options that can be customized.'=>'Jeder hat ein anderes Aussehen und Optionen, die angepasst werden können.','The "Classic" design is the most similar Print My Blog’s Quick Print, so it’s a good default choice.'=>'Das "Classic"-Design ist das ähnlichste Print My Blog Quick Print, also ist es eine gute Standardwahl.','Click on the preview image for more details, and feel free to come back to this page later if you want to try a different design.'=>'Klicken Sie auf das Vorschaubild für weitere Details, und zögern Sie nicht, später auf diese Seite zurückzukehren, wenn Sie ein anderes Design ausprobieren möchten.','Read the User Guide'=>'Lesen Sie das Benutzerhandbuch','Each Design has Different Options and is Reusable'=>'Jedes Design hat verschiedene Optionen und ist wiederverwendbar','Below are your chosen design’s customization options.'=>'Im Folgenden finden Sie die Anpassungsoptionen Ihres ausgewählten Designs.','If you don’t see an option you need, you may want to go back and choose a different design, or ask the design’s author for it.'=>'Wenn Sie keine Option sehen, die Sie benötigen, sollten Sie zurückgehen und ein anderes Design auswählen oder den Autor des Entwurfs danach fragen.','Note: designs are reused between projects. So customizations to this design will be reused by other projects using this same design'=>'Hinweis: Entwürfe werden zwischen Projekten wiederverwendet. Daher werden Anpassungen dieses Entwurfs von anderen Projekten wiederverwendet, die denselben Entwurf verwenden.','How to Edit Project Content'=>'Bearbeiten von Projektinhalten','Find the articles (posts, pages, other post types) from WordPress you want to add on the left, and add it to your project on the right by dragging'=>'Finden Sie die Artikel (Beiträge, Seiten, andere Beitragstypen) von WordPress, die Sie auf der linken Seite hinzufügen möchten, und fügen Sie sie Ihrem Projekt auf der rechten Seite hinzu, indem Sie ziehen','Title Page and Table of Contents print materials are automatically added to each project, but you can remove or %1$scustomize them%2$s.'=>'Titelseite und Inhaltsverzeichnis Druckmaterialien werden automatisch zu jedem Projekt hinzugefügt, aber Sie können sie entfernen oder %1$sanpassen%2$s.','Place articles in either front matter, body, or back matter, according to how you want your project organized. Each design can style them differently (eg front matter is often is numbered with roman numerals)'=>'Platzieren Sie Artikel entweder in Front-, Haupt- oder Rückseiten, je nachdem, wie Ihr Projekt organisiert werden soll. Jedes Design kann sie anders formatieren (z.B. Frontmaterie ist oft mit römischen Ziffern nummeriert)','Nest content inside others to create parts'=>'Verschachteln von Inhalten in anderen, um Teile zu erstellen','Read the User Guide on how to edit your project\'s content.'=>'Lesen Sie das Benutzerhandbuch, um zu erfahren, wie Sie den Inhalt Ihres Projekts bearbeiten können.','Everything Else About Your Project is Stored Here'=>'Alles andere über Ihr Projekt wird hier gespeichert','Different formats and designs may require other information about your project.'=>'Für verschiedene Formate und Designs sind möglicherweise andere Informationen zu Ihrem Projekt erforderlich.','Some examples of metadata are: title page info, file info, or copyright data.'=>'Einige Beispiele für Metadaten sind: Titelseiteninformationen, Dateiinformationen oder Copyright-Daten.','So although your choice of design may affect what metadata is required, it is not shared with other projects.'=>'Obwohl sich Ihre Entwurfsauswahl auf die erforderlichen Metadaten auswirken kann, wird sie nicht für andere Projekte freigegeben.','Generate and View Your File'=>'Generieren und Anzeigen Ihrer Datei','Your project is ready to be generated! Clicking "Generate" will compile your content into a print-page.'=>'Ihr Projekt kann generiert werden! Wenn Sie auf "Generieren" klicken, werden Ihre Inhalte in ein Dokument kompiliert. Klicken Sie dann auf "Ansicht".','Read the User Guide on %1$supdating%2$s, %3$sgenerating the pro file%2$s, and %4$sgetting help%2$s.'=>'Lesen Sie das Benutzerhandbuch zum %1$saktualisieren%2$s, %3$sgenerieren der Pro-Datei%2$s und %4$sHilfeerhalten%2$s.','Posts just for Print My Blog'=>'Beiträge nur für Print My Blog','Print My Blog "Print Materials" are like private posts. They aren’t visible to site visitors, but you can use them in your Pro Print Projects.'=>'Meinen Blog "Druckmaterialien" sind wie private Beiträge. Sie sind für Websitebesucher nicht sichtbar, sie können jedoch in Ihren Pro Print-Projekten verwendet werden.','Title Page'=>'Titelseite','Table of Contents'=>'Inhaltsverzeichnis','Single Column'=>'Einzelspalte','Fullpage Content'=>'Vollständiger Inhalt','Centered Content'=>'Zentrierte Inhalte','Full Column Content'=>'Vollständiger Inhalt','Important'=>'Wichtig','Print'=>'Drucken','Print 🖨'=>'Drucken 🖨','PDF'=>'PDF','PDF 📄'=>'PDF-📄','eBook'=>'E-Book','eBook 📱'=>'eBook 📱','Invalid format "%s".'=>'Ungültiges Format "%s".','Site Title'=>'Seitentitel','Tagline'=>'Slogan','Filters Used'=>'Verwendete Filter','E.g. selected categories, taxonomies, and date range.'=>'Z. B. ausgewählte Kategorien, Taxonomien und Datumsbereich.','Credit Print My Blog Plugin'=>'Credit Print Mein Blog-Plugin','Show some love and tell your readers about Print My Blog %1$s'=>'Zeigen Sie etwas Liebe und erzählen Sie Ihren Lesern von Print My Blog %1$s','Extra dividing line at end of post'=>'Zusätzliche Trennlinie am Ende der Post','1'=>'1','2'=>'2','3'=>'3','The number of columns of text on each page. Not supported by some web browsers.'=>'Die Anzahl der Textspalten auf jeder Seite. Von einigen Webbrowsern nicht unterstützt.','Pro Print lets you specify header and text size and font'=>'Mit Pro Print können Sie Kopf- und Textgröße und Schriftart angeben','Tiny (1/2 size)'=>'Winzig (1/2 Größe)','Small (3/4 size)'=>'Klein (3/4 Größe)','Normal (theme default)'=>'Normal (Designstandard)','Large (slightly larger than normal)'=>'Groß (etwas größer als normal)','Image Size'=>'Bildgröße','Full (theme default)'=>'Vollständig (Designstandard)','Large (3/4 size)'=>'Groß (3/4 Größe)','Medium (1/2 size)'=>'Mittel (1/2 Größe)','Small (1/4 size)'=>'Klein (1/4 Größe)','None (hide images)'=>'Keine (Bilder ausblenden)','If you want to save paper, choose a smaller image size, or hide images altogether.'=>'Wenn Sie Papier speichern möchten, wählen Sie eine kleinere Bildgröße aus, oder blenden Sie Bilder vollständig aus.','Include Hyperlinks'=>'Hyperlinks einschließen','Pro Print with Pro PDF Service supports changing hyperlinks to page references or footnotes'=>'Pro Print mit Pro PDF Service unterstützt das Ändern von Hyperlinks zu Seitenverweisen oder Fußnoten','Include'=>'Einschließen','Replace with URL in Parenthesis'=>'Ersetzen durch URL in Klammern','Note: PDFs generated in Firefox and Safari automatically remove hyperlinks. If you want your PDF to include hyperlinks, please use another browser.'=>'Hinweis: In Firefox und Safari generierte PDFs entfernen automatisch Hyperlinks. Wenn Sie möchten, dass Ihre PDF-Datei Hyperlinks enthält, verwenden Sie bitte einen anderen Browser.','Post Rendering Wait-Time'=>'Wartezeit nach dem Rendern','ms'=>'ms','Milliseconds to wait between rendering posts. If posts are rendered too quickly on the page, sometimes images won’t load properly. '=>'Millisekunden, um zwischen dem Rendern von Beiträgen zu warten. Wenn Beiträge zu schnell auf der Seite gerendert werden, werden Bilder manchmal nicht richtig geladen. ','Include Inline Javascript'=>'Inline-Javascript einschließen','Sometimes posts contain inline javascript which can cause errors and stop the page from rendering.'=>'Manchmal enthalten Beiträge Inline-Javascript, die Fehler verursachen und das Rendern der Seite verhindern können.','Include Unrendered Shortcodes'=>'Nicht gerenderte Shortcodes einschließen','If you left shortcodes from deactivated deactivated plugins or themes in your posts, they are automatically removed from printouts. Check this to leave them.'=>'Wenn Sie Shortcodes von deaktivierten deaktivierten Plugins oder Themen in Ihren Beiträgen hinterlassen haben, werden sie automatisch aus Ausdrucken entfernt. Überprüfen Sie dies, um sie zu verlassen.','article'=>'Artikel','part'=>'Teil','volume'=>'Menge','anthology'=>'Anthologie','No generator class specified for format "%s"'=>'Für das Format "%s" wurde keine Generatorklasse angegeben.','Setup'=>'Setup','Choose %s Design'=>'Wählen Sie %s Design','Customize %s Design'=>'Anpassen %s Designs','Edit Content'=>'Inhalt bearbeiten','Edit Metadata'=>'Metadaten bearbeiten','Generate Print Page'=>'Generieren der Druckseite','The design with slug "%s" should exist but doesn\'t. Check the plugin that added that design is still active (and if it required a subscription, that the subscription is still up-to-date). For now, please choose a different design.'=>'Das Design mit Schnecke "%s" sollte existieren, tut es aber nicht. Überprüfen Sie, ob das Plugin, das dieses Design hinzugefügt hat, noch aktiv ist (und wenn ein Abonnement erforderlich ist, dass das Abonnement noch auf dem neuesten Stand ist). Für den Moment wählen Sie bitte ein anderes Design.','Template file "%s" should exist but doesn\'t.'=>'Die Vorlagendatei "%s" sollte vorhanden sein, tut es aber nicht.','Default Template'=>'Standard-Template','No license ID available'=>'Keine Lizenz-ID verfügbar','There is no site registered with Freemius'=>'Es ist keine Website bei Freemius registriert','Your project is very big and you might have errors downloading the file. If so, try splitting your content into multiple projects and instead creating multiple smaller files.'=>'Ihr Projekt ist sehr groß und beim Herunterladen der Datei können Fehler auftreten. Wenn ja, versuchen Sie, Ihre Inhalte in mehrere Projekte aufzuteilen und stattdessen mehrere kleinere Dateien zu erstellen.','Your project has lots of images and you might have errors downloading the file. If so, try spltting your content into multiple projects or reducing the image quality set on your design.'=>'Ihr Projekt enthält viele Bilder und beim Herunterladen der Datei liegen möglicherweise Fehler auf. Wenn dies der Fall ist, versuchen Sie, Ihre Inhalte in mehrere Projekte zu verteilen oder die für Ihr Design festgelegte Bildqualität zu reduzieren.','Downloading the Paid PDF will use one of your %1$s remaining credits, and is non-refundable.'=>'Das Herunterladen der kostenpflichtigen PDF-Datei verwendet eine Ihrer %1$s verbleibenden Credits und ist nicht erstattungsfähig.','Table of content - In Microsoft Word, please right-click and choose "Update field".'=>'Inhaltsverzeichnis - Bitte klicken Sie mit der rechten Maustaste und wählen Sie "Feld aktualisieren".','Projects'=>'Projekte','Projects for printing with Print My Blog'=>'Projekte zum Drucken mit Print My Blog','Designs for printing with Print My Blog'=>'Designs für den Druck mit Print My Blog','Post type general name' . "\4" . 'Print Materials'=>'Druckmaterialien','Post type singular name' . "\4" . 'Print Material'=>'Druckmaterial','Admin Menu text' . "\4" . 'Print Materials'=>'Druckmaterialien','Add New on Toolbar' . "\4" . 'Print Material'=>'Druckmaterial','Add New'=>'Neu hinzufügen','Add New Print Material'=>'Schnelles Hinzufügen von Druckmaterial','New Print Material'=>'Neues Druckmaterial','Edit Print Material'=>'Druckmaterial bearbeiten','View Print Material'=>'Druckmaterial ansehen','All Print Materials'=>'Alle Druckmaterialien','Search Print Materials'=>'Druckmaterialien suchen','Parent Print Materials:'=>'Übergeordnete Druckmaterialien:','No Print Materials found.'=>'Keine Druckmaterialien gefunden.','No Print Materials found in Trash.'=>'Keine Druckmaterialien im Papierkorb gefunden.','Overrides the “Featured Image” phrase for this post type. Added in 4.3' . "\4" . 'Print Material Cover Image'=>'Druckmaterial','Overrides the “Set featured image” phrase for this post type. Added in 4.3' . "\4" . 'Set cover image'=>'Titelbild festlegen','Overrides the “Remove featured image” phrase for this post type. Added in 4.3' . "\4" . 'Remove cover image'=>'Cover-Bild entfernen','Overrides the “Use as featured image” phrase for this post type. Added in 4.3' . "\4" . 'Use as cover image'=>'Als Titelbild verwenden','The post type archive label used in nav menus. Default “Post Archives”. Added in 4.4' . "\4" . 'Print Material archives'=>'Druckmaterialien','Overrides the “Insert into post”/”Insert into page” phrase (used when inserting media into a post). Added in 4.4' . "\4" . 'Insert into Print Material'=>'In Druckmaterial einfügen','Overrides the “Uploaded to this post”/”Uploaded to this page” phrase (used when viewing media attached to a post). Added in 4.4' . "\4" . 'Uploaded to this Print Material'=>'Zu diesem Druckmaterial hochgeladen','Screen reader text for the filter links heading on the post type listing screen. Default “Filter posts list”/”Filter pages list”. Added in 4.4' . "\4" . 'Filter Print Materials list'=>'Liste der Druckmaterialien filtern','Screen reader text for the pagination heading on the post type listing screen. Default “Posts list navigation”/”Pages list navigation”. Added in 4.4' . "\4" . 'Print Materials list navigation'=>'Navigation in der Liste der Druckmaterialien','Screen reader text for the items list heading on the post 