ar und "Weiterführende Literatur". %1$s Lesen Sie mehr. %2$s','Quick Add Print Material'=>'Schnelles Hinzufügen von Druckmaterial','How to Edit Project Content Using Only Your Keyboard'=>'Bearbeiten von Projektinhalten','Use <b>tab</b> key to focus on the searchbox, other buttons, and the project items. '=>'Verwenden <b></b> Sie die Tabulatortaste, um sich auf das Suchfeld, andere Schaltflächen und die Projektelemente zu konzentrieren.','Once a project item has focus, press <b>spacebar</b> to toggle selecting it. Select more items in the same way.'=>'Sobald ein Projektelement den Fokus hat, drücken Sie die <b>Leertaste,</b> um die Auswahl umzuschalten. Wählen Sie weitere Elemente auf die gleiche Weise aus.','Once items are selected, press <b>enter</b> to add them to the project\'s body.'=>'Sobald Elemente ausgewählt sind, drücken <b>Sie die Eingabetaste,</b> um sie zur Hauptsache des Projekts hinzuzufügen.','Press <b>up</b> or <b>down</b> keys to move the selected items up or down in the project.'=>'Drücken Sie die Tasten <b>nach oben</b> oder <b>unten,</b> um die ausgewählten Elemente im Projekt nach oben oder unten zu verschieben.','Press escape to unselect everything.'=>'Drücken Sie die Esc-Taste, um die Auswahl aufzuheben.','You have %1$s/%2$s download credits left which expire on %3$s'=>'Sie haben noch %1$s/%2$s Download-Credits, die am %3$s ablaufen','Generate'=>'Generieren','Change Design'=>'Änderungsdesign','Customize Design'=>'Anpassen %s Designs','View %s Print Page'=>'Anzeigen %s Druckseite','Need to Change Something?'=>'Müssen Sie etwas ändern?','Change Title or Format'=>'Titel oder Format ändern','Clear Cached Resources'=>'Zwischengespeicherte Ressourcen löschen','Get Help'=>'Hilfe erhalten','Edit Project Metadata'=>'Bearbeiten von Projektmetadaten','Edit Project'=>'Projekt bearbeiten','Submit & Proceed'=>'Einreichen & Weitergehen','Pro Print ― Projects'=>'Pro Print - Projekte','Add New Project'=>'Neues Projekt hinzufügen','Print My Blog - Settings'=>'Print My Blog - Einstellungen','Front-End Print Buttons'=>'Drucktasten','Viewers will see these buttons when they visit your website.'=>'Zuschauer sehen diese Schaltflächen, wenn sie Ihre Website besuchen.','These are the legacy print buttons which use the "Quick Print" technology. We\'re currently working on new print buttons that will use "Pro Print" technology.'=>'Dies sind die alten Druckschaltflächen, die die "Quick Print"-Technologie verwenden. Wir arbeiten derzeit an neuen Druckschaltflächen, die die "Pro Print"-Technologie verwenden werden.','Posts'=>'Beiträge','Pages'=>'Seiten','Customize Buttons'=>'Anpassen von Schaltflächen','Place Buttons'=>'Place Buttons','Above Content'=>'Oberhalb von Inhalt','Below Content'=>'Unterhalb von Inhalt','Preview Settings'=>'Einstellungen der Vorschauseite','Open Quick Print preview page in a new tab. '=>'Öffnen Sie die Quick Print-Vorschauseite in einer neuen Registerkarte. ','Note: Leaving this setting unchecked will open the preview page in the active window.'=>'Hinweis: Wenn Sie diese Einstellung nicht markieren, wird die Vorschauseite im aktiven Fenster geöffnet.','Label'=>'Label','Admin Print Buttons'=>'Drucktasten','Administrators and other privileged users will see these in the wp-admin (like when editing a post.)'=>'Administratoren und andere privilegierte Benutzer sehen diese im wp-admin (wie beim Bearbeiten eines Beitrags).','These print buttons use "Pro Print" technology (which has both free and paid options.)'=>'Diese Druckschaltflächen verwenden die "Pro Print"-Technologie (die sowohl kostenlose als auch kostenpflichtige Optionen bietet).','Save Settings'=>'Einstellungen speichern','Are you sure you want to reset the settings back to defaults?'=>'Möchten Sie die Einstellungen wirklich wieder auf die Standardeinstellungen zurücksetzen?','Reset to Defaults'=>'Auf Standard zurücksetzen','Print My Blog - Quick Print'=>'Print My Blog - Schnelldruck','Configure how you’d like the blog to be printed, or just use our recommended defaults.'=>'Konfigurieren Sie, wie der Blog gedruckt werden soll, oder verwenden Sie einfach unsere empfohlenen Standardeinstellungen.','Site URL (including "https://" or "http://")'=>'Website-URL (einschließlich "https://" oder "http://")','URL of the WordPress site (self-hosted or on WordPress.com) you’d like to print. Leave blank to use this current site.'=>'URL der WordPress-Website (selbst gehostet oder auf WordPress.com), die Sie drucken möchten. Lassen Sie leer, um diese aktuelle Website zu verwenden.','Paper'=>'Papier','Print a physical copy using your web browser’s print functionality.'=>'Drucken Sie eine physische Kopie mit der Druckfunktion Ihres Webbrowsers.','Make a PDF file, intended for reading from a computer or other device, using your browser or a browser extension.'=>'Erstellen Sie eine PDF-Datei, die zum Lesen von einem Computer oder einem anderen Gerät bestimmt ist, mit Ihrem Browser oder einer Browser-Erweiterung.','eBook (ePub or MOBI)'=>'eBook (ePub oder MOBI)','Make a free eBook using dotEPUB.'=>'Erstellen Sie ein kostenloses eBook mit dotEPUB.','HTML'=>'HTML','Easily copy-and-paste into another program like Microsoft Word or Google Docs. Note: this is not recommended for customizing printouts, as other programs usually format the content poorly. Instead, use Print My Blog’s CSS classes to remove or add content from printouts.'=>'Kopieren und Einfügen in ein anderes Programm wie Microsoft Word oder Google Docs. Hinweis: Dies wird nicht zum Anpassen von Ausdrucken empfohlen, da andere Programme den Inhalt in der Regel schlecht formatieren. Verwenden Sie stattdessen die CSS-Klassen von Print My Blog, um Inhalte aus Ausdrucken zu entfernen oder hinzuzufügen.','Learn More'=>'Mehr erfahren','Show More Print Options'=>'Weitere Druckoptionen anzeigen','Options'=>'Optionen','Post Selection'=>'Briefwahl','Pro Print supports custom post types, combining posts with pages, and print-only materials'=>'Drucken unterstützt benutzerdefinierte Posttypen und kombiniert Beiträge mit Seiten und nur gedruckten Materialien','Order'=>'Bestellung','Pro Print supports drag-and-drop ordering of content.'=>'Pro Print unterstützt die Drag-and-Drop-Reihenfolge von Inhalten.','Posts will be ordered:'=>'Beiträge werden bestellt:','Oldest First'=>'Älteste zuerst','Newest First'=>'Neueste zuerst','Pages will be ordered using the "Order" attribute:'=>'Seiten werden mit dem Attribut "Order" sortiert:','From Lowest to Highest'=>'Von der niedrigsten zum höchsten','From Highest to Lowest'=>'Von der Höchsten bis zur niedrigsten','Password-Protected'=>'Passwortgeschützt','Statuses'=>'Status','Filters'=>'Filter','Pro Print supports filtering by custom taxonomies.'=>'Pro Print unterstützt ganzseitige Titelseiten, benutzerdefinierte Titelseiten oder keine Titelseite','Authored By'=>'Verfasst von','Posted After (and Including)'=>'Posted After (und einschließlich)','Posted Before (and Including)'=>'Vor (und einschließlich) gepostet','Prepare Print-Page'=>'Vorbereiten der Print-Seite','It’s finally here...'=>'Endlich ist es da...','Print My Blog – Pro Print!'=>'Print My Blog — Pro Print','The old features are still here: "Print Now" was just renamed "Quick Print", and the Print Buttons are still available under "Settings".'=>'Die alten Features sind noch da: "Print Now" wurde gerade in "Quick Print" umbenannt, und die Drucktasten sind noch unter "Einstellungen" verfügbar.','Pro Print makes more functional and visually-appealing PDFs using your web browser for free, or the new paid Pro PDF Service.'=>'Pro Print macht funktionalere und visuell ansprechende PDFs mit Ihrem Webbrowser kostenlos oder den neuen kostenpflichtigen Pro PDF Service.','Automatic Table of Contents'=>'Automatisches Inhaltsverzeichnis','Add a table of contents to your project, with links and page numbers.'=>'Fügen Sie Ihrem Projekt ein Inhaltsverzeichnis mit Links und Seitenzahlen hinzu.','Pro PDF Service adds page numbers.'=>'Pro PDF Service','Automatic page references and footnotes'=>'Automatisches Konvertieren von Hyperlinks in Seitenverweise und Fußnoten','Hyperlinks can be automatically converted into references to the page the linked-to content is located, or a footnote with the web address print-out.'=>'Hyperlinks können automatisch in Verweise auf die Seite umgewandelt werden, auf der sich der verknüpfte Inhalt befindet, oder in eine Fußnote mit dem Ausdruck der Webadresse.','Proper margins, page numbers and running heads'=>'Richtige Ränder, Seitenzahlen und Laufköpfe','Clean margins, alternating page numbers, roman numerals for front matter, running chapter heads, and more.'=>'Saubere Ränder, wechselnde Seitenzahlen, römische Ziffern für Frontmaterie, laufende Kapitelköpfe und vieles mehr.','Support Custom Post Types'=>'Unterstützung benutzerdefinierter Posttypen','Content from other plugins, like WooCommerce Products, or your LMS\'s course materials, can be included in projects.'=>'Inhalte aus anderen Plugins, wie WooCommerce Products oder die Kursmaterialien Ihres LMS, können in Projekte aufgenommen werden.','Drag-and-Drop Content Organizer'=>'Drag-and-Drop-Inhalte in Projekte','Drop posts, pages, and other post types into projects in any order. Even organize them into parts.'=>'Legen Sie Beiträge, Seiten und andere Beitragstypen in Beliebiger Reihenfolge in Projekte ab. Sogar organisieren sie in Teilen.','Premade, Reusable, Customizable Designs'=>'Vorgefertigte, wiederverwendbare, anpassbare Designs','Print My Blog\'s Designs are like WordPress Themes: each has its own look and customization options. Reuse the same design across projects. Or even create your own design using HTML, CSS, and Javascript'=>'Drucken Sie die Designs meines Blogs sind wie WordPress-Themes: jeder hat seinen eigenen Look und Anpassungsmöglichkeiten. Verwenden Sie den gleichen Entwurf projektübergreifend wieder. Oder erstellen Sie sogar Ihr eigenes Design mit HTML, CSS und Javascript','Pro PDF Service lets designs fully control the margins, page backgrounds, and los of other aspects.'=>'Mit Pro PDF Service können Designs die Ränder, Seitenhintergründe und den Verlust anderer Aspekte vollständig steuern.','Saveable Projects'=>'Generieren des Projekts','Save where you left off.'=>'Speichern Sie dort, wo Sie aufgehört haben.','Front matter, back matter, parts, and print materials'=>'Frontmaterial, Rückenmaterial, Teile und Druckmaterialien','Add front and back matter to books, organize the content into parts, and add special "print material" posts to use only in your projects'=>'Hinzufügen von Front- und Rückseitenmaterial zu Büchern, Organisieren des Inhalts in Teilen und Hinzufügen spezieller "Druckmaterial"-Beiträge, die nur in Ihren Projekten verwendet werden können','Features Include:'=>'Beitragsbild:','Try Pro Print Now'=>'Pro Print','Learn More on printmy.blog'=>'Erfahren Sie mehr über printmy.blog','Please %1$slet me know%2$s if you have any questions!'=>'Bitte %1$sLassen Sie mich wissen%2$s wenn Sie Fragen haben!','Best wishes, Mike Nelson, Print My Blog Developer'=>'Beste Wünsche, Mike Nelson, Print My Blog Developer','Welcome to %s!'=>'Willkommen bei %s!','Print My Blog Pro'=>'Print My Blog Pro','What would you like to do?'=>'Was möchtest Sie tun?','Print My Blog Now for Free'=>'Drucken Sie meinen Blog jetzt kostenlos','Use Quick Print'=>'Verwenden von Schnelldruck','2 clicks to printing'=>'2 Klicks zum Drucken','No watermark'=>'Kein Wasserzeichen','Print Thousands of Pages from your Web Browser'=>'Drucken Von Tausenden von Seiten in Ihrem Webbrowser','Let Visitors Print My Blog for Free'=>'Lassen Sie Besucher meinen Blog kostenlos drucken','Configure the Print Button Settings'=>'Konfigurieren der Druckschaltflächeneinstellungen','No Coding Required'=>'Keine Codierung erforderlich','Highly Customizable'=>'Hochgradig anpassbar','Place Print Buttons Anywhere'=>'Platzieren Sie Drucktasten an beliebiger Stelle','Make Professional Books and Documents'=>'Erstellen von professionellen Büchern und Dokumenten','Use Pro Print'=>'Verwenden von Pro Print','Free and Paid Options'=>'Kostenlos, mit kostenpflichtigen Optionen','Drag-and-drop content into projects'=>'Drag-and-Drop-Inhalte in Projekte','Include any post types, in any order'=>'Alle Posttypen in beliebiger Reihenfolge einschließen','Choose and Customize Many Designs, or code your own'=>'Wählen und anpassen Sie viele Designs, oder programmieren Sie Ihre eigenen','Automatically convert hyperlinks to page references and footnotes'=>'Automatisches Konvertieren von Hyperlinks in Seitenverweise und Fußnoten','https://printmy.blog'=>'https://printmy.blog','Make printing your blog easy and impressive. For you & your visitors. One post or thousands.'=>'Machen Sie das Drucken Ihres Blogs einfach und beeindruckend. Für Sie und Ihre Besucher. Ein Beitrag oder Tausende.','Michael Nelson'=>'Michael Nelson']];
